Ext.data.JsonP.com_android_location_provider_LocationRequestUnbundled({"tagname":"class","name":"com.android.location.provider.LocationRequestUnbundled","autodetected":{},"files":[{"filename":"LocationRequestUnbundled.js","href":"LocationRequestUnbundled.html#com-android-location-provider-LocationRequestUnbundled"}],"extends":"java.lang.Object","members":[{"name":"ACCURACY_BLOCK","tagname":"property","owner":"com.android.location.provider.LocationRequestUnbundled","id":"property-ACCURACY_BLOCK","meta":{}},{"name":"ACCURACY_CITY","tagname":"property","owner":"com.android.location.provider.LocationRequestUnbundled","id":"property-ACCURACY_CITY","meta":{}},{"name":"ACCURACY_FINE","tagname":"property","owner":"com.android.location.provider.LocationRequestUnbundled","id":"property-ACCURACY_FINE","meta":{}},{"name":"POWER_HIGH","tagname":"property","owner":"com.android.location.provider.LocationRequestUnbundled","id":"property-POWER_HIGH","meta":{}},{"name":"POWER_LOW","tagname":"property","owner":"com.android.location.provider.LocationRequestUnbundled","id":"property-POWER_LOW","meta":{}},{"name":"POWER_NONE","tagname":"property","owner":"com.android.location.provider.LocationRequestUnbundled","id":"property-POWER_NONE","meta":{}},{"name":"getFastestInterval","tagname":"method","owner":"com.android.location.provider.LocationRequestUnbundled","id":"method-getFastestInterval","meta":{}},{"name":"getInterval","tagname":"method","owner":"com.android.location.provider.LocationRequestUnbundled","id":"method-getInterval","meta":{}},{"name":"getQuality","tagname":"method","owner":"com.android.location.provider.LocationRequestUnbundled","id":"method-getQuality","meta":{}},{"name":"getSmallestDisplacement","tagname":"method","owner":"com.android.location.provider.LocationRequestUnbundled","id":"method-getSmallestDisplacement","meta":{}},{"name":"isLocationSettingsIgnored","tagname":"method","owner":"com.android.location.provider.LocationRequestUnbundled","id":"method-isLocationSettingsIgnored","meta":{}},{"name":"toString","tagname":"method","owner":"com.android.location.provider.LocationRequestUnbundled","id":"method-toString","meta":{}}],"alternateClassNames":[],"aliases":{},"id":"class-com.android.location.provider.LocationRequestUnbundled","short_doc":"This class is an interface to LocationRequests for unbundled applications. ...","classIcon":"icon-class","superclasses":["java.lang.Object"],"subclasses":[],"mixedInto":[],"mixins":[],"parentMixins":[],"requires":[],"uses":[],"html":"<div><pre class=\"hierarchy\"><h4>Hierarchy</h4><div class='subclass first-child'>java.lang.Object<div class='subclass '><strong>com.android.location.provider.LocationRequestUnbundled</strong></div></div><h4>Files</h4><div class='dependency'><a href='source/LocationRequestUnbundled.html#com-android-location-provider-LocationRequestUnbundled' target='_blank'>LocationRequestUnbundled.js</a></div></pre><div class='doc-contents'><p>This class is an interface to LocationRequests for unbundled applications.</p>\n\n<p> <p>IMPORTANT: This class is effectively a public API for unbundled\n applications, and must remain API stable. See README.txt in the root\n of this package for more information.</p>\n</div><div class='members'><div class='members-section'><div class='definedBy'>Defined By</div><h3 class='members-title icon-property'>Properties</h3><div class='subsection'><div id='property-ACCURACY_BLOCK' class='member first-child not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='com.android.location.provider.LocationRequestUnbundled'>com.android.location.provider.LocationRequestUnbundled</span><br/><a href='source/LocationRequestUnbundled.html#com-android-location-provider-LocationRequestUnbundled-property-ACCURACY_BLOCK' target='_blank' class='view-source'>view source</a></div><a href='#!/api/com.android.location.provider.LocationRequestUnbundled-property-ACCURACY_BLOCK' class='name expandable'>ACCURACY_BLOCK</a> : String<span class=\"signature\"></span></div><div class='description'><div class='short'>Returned by getQuality when requesting \"block\" level accuracy. ...</div><div class='long'><p>Returned by <a href=\"#!/api/com.android.location.provider.LocationRequestUnbundled-method-getQuality\" rel=\"com.android.location.provider.LocationRequestUnbundled-method-getQuality\" class=\"docClass\">getQuality</a> when requesting \"block\" level accuracy.</p>\n\n<p><p>Block level accuracy is considered to be about 100 meter accuracy,\nalthough this is implementation dependent. Using a coarse accuracy\nsuch as this often consumes less power.</p>\n<p>Defaults to: <code>&quot;102&quot;</code></p></div></div></div><div id='property-ACCURACY_CITY' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='com.android.location.provider.LocationRequestUnbundled'>com.android.location.provider.LocationRequestUnbundled</span><br/><a href='source/LocationRequestUnbundled.html#com-android-location-provider-LocationRequestUnbundled-property-ACCURACY_CITY' target='_blank' class='view-source'>view source</a></div><a href='#!/api/com.android.location.provider.LocationRequestUnbundled-property-ACCURACY_CITY' class='name expandable'>ACCURACY_CITY</a> : String<span class=\"signature\"></span></div><div class='description'><div class='short'>Returned by getQuality when requesting \"city\" level accuracy. ...</div><div class='long'><p>Returned by <a href=\"#!/api/com.android.location.provider.LocationRequestUnbundled-method-getQuality\" rel=\"com.android.location.provider.LocationRequestUnbundled-method-getQuality\" class=\"docClass\">getQuality</a> when requesting \"city\" level accuracy.</p>\n\n<p><p>City level accuracy is considered to be about 10km accuracy,\nalthough this is implementation dependent. Using a coarse accuracy\nsuch as this often consumes less power.</p>\n<p>Defaults to: <code>&quot;104&quot;</code></p></div></div></div><div id='property-ACCURACY_FINE' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='com.android.location.provider.LocationRequestUnbundled'>com.android.location.provider.LocationRequestUnbundled</span><br/><a href='source/LocationRequestUnbundled.html#com-android-location-provider-LocationRequestUnbundled-property-ACCURACY_FINE' target='_blank' class='view-source'>view source</a></div><a href='#!/api/com.android.location.provider.LocationRequestUnbundled-property-ACCURACY_FINE' class='name expandable'>ACCURACY_FINE</a> : String<span class=\"signature\"></span></div><div class='description'><div class='short'>Returned by getQuality when requesting the most accurate locations available. ...</div><div class='long'><p>Returned by <a href=\"#!/api/com.android.location.provider.LocationRequestUnbundled-method-getQuality\" rel=\"com.android.location.provider.LocationRequestUnbundled-method-getQuality\" class=\"docClass\">getQuality</a> when requesting the most accurate locations available.</p>\n\n<p><p>This may be up to 1 meter accuracy, although this is implementation dependent.</p>\n<p>Defaults to: <code>&quot;100&quot;</code></p></div></div></div><div id='property-POWER_HIGH' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='com.android.location.provider.LocationRequestUnbundled'>com.android.location.provider.LocationRequestUnbundled</span><br/><a href='source/LocationRequestUnbundled.html#com-android-location-provider-LocationRequestUnbundled-property-POWER_HIGH' target='_blank' class='view-source'>view source</a></div><a href='#!/api/com.android.location.provider.LocationRequestUnbundled-property-POWER_HIGH' class='name expandable'>POWER_HIGH</a> : String<span class=\"signature\"></span></div><div class='description'><div class='short'>Returned by getQuality when allowing high power consumption for location. ...</div><div class='long'><p>Returned by <a href=\"#!/api/com.android.location.provider.LocationRequestUnbundled-method-getQuality\" rel=\"com.android.location.provider.LocationRequestUnbundled-method-getQuality\" class=\"docClass\">getQuality</a> when allowing high power consumption for location.</p>\n\n<p><p>This location request will allow high power location work.</p>\n<p>Defaults to: <code>&quot;203&quot;</code></p></div></div></div><div id='property-POWER_LOW' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='com.android.location.provider.LocationRequestUnbundled'>com.android.location.provider.LocationRequestUnbundled</span><br/><a href='source/LocationRequestUnbundled.html#com-android-location-provider-LocationRequestUnbundled-property-POWER_LOW' target='_blank' class='view-source'>view source</a></div><a href='#!/api/com.android.location.provider.LocationRequestUnbundled-property-POWER_LOW' class='name expandable'>POWER_LOW</a> : String<span class=\"signature\"></span></div><div class='description'><div class='short'>Returned by getQuality when requesting low power impact. ...</div><div class='long'><p>Returned by <a href=\"#!/api/com.android.location.provider.LocationRequestUnbundled-method-getQuality\" rel=\"com.android.location.provider.LocationRequestUnbundled-method-getQuality\" class=\"docClass\">getQuality</a> when requesting low power impact.</p>\n\n<p><p>This location request will avoid high power location work where\npossible.</p>\n<p>Defaults to: <code>&quot;201&quot;</code></p></div></div></div><div id='property-POWER_NONE' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='com.android.location.provider.LocationRequestUnbundled'>com.android.location.provider.LocationRequestUnbundled</span><br/><a href='source/LocationRequestUnbundled.html#com-android-location-provider-LocationRequestUnbundled-property-POWER_NONE' target='_blank' class='view-source'>view source</a></div><a href='#!/api/com.android.location.provider.LocationRequestUnbundled-property-POWER_NONE' class='name expandable'>POWER_NONE</a> : String<span class=\"signature\"></span></div><div class='description'><div class='short'>Returned by getQuality when requiring no direct power impact (passive locations). ...</div><div class='long'><p>Returned by <a href=\"#!/api/com.android.location.provider.LocationRequestUnbundled-method-getQuality\" rel=\"com.android.location.provider.LocationRequestUnbundled-method-getQuality\" class=\"docClass\">getQuality</a> when requiring no direct power impact (passive locations).</p>\n\n<p><p>This location request will not trigger any active location requests,\nbut will receive locations triggered by other applications. Your application\nwill not receive any direct power blame for location work.</p>\n<p>Defaults to: <code>&quot;200&quot;</code></p></div></div></div></div></div><div class='members-section'><div class='definedBy'>Defined By</div><h3 class='members-title icon-method'>Methods</h3><div class='subsection'><div id='method-getFastestInterval' class='member first-child not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='com.android.location.provider.LocationRequestUnbundled'>com.android.location.provider.LocationRequestUnbundled</span><br/><a href='source/LocationRequestUnbundled.html#com-android-location-provider-LocationRequestUnbundled-method-getFastestInterval' target='_blank' class='view-source'>view source</a></div><a href='#!/api/com.android.location.provider.LocationRequestUnbundled-method-getFastestInterval' class='name expandable'>getFastestInterval</a>( <span class='pre'></span> ) : Number<span class=\"signature\"></span></div><div class='description'><div class='short'>Get the fastest interval of this request, in milliseconds. ...</div><div class='long'><p>Get the fastest interval of this request, in milliseconds.</p>\n\n<p> <p>The system will never provide location updates faster\n than the minimum of <a href=\"#!/api/com.android.location.provider.LocationRequestUnbundled-method-getFastestInterval\" rel=\"com.android.location.provider.LocationRequestUnbundled-method-getFastestInterval\" class=\"docClass\">getFastestInterval</a> and\n <a href=\"#!/api/com.android.location.provider.LocationRequestUnbundled-method-getInterval\" rel=\"com.android.location.provider.LocationRequestUnbundled-method-getInterval\" class=\"docClass\">getInterval</a>.</p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>Number</span><div class='sub-desc'><p>fastest interval in milliseconds, exact</p>\n</div></li></ul></div></div></div><div id='method-getInterval' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='com.android.location.provider.LocationRequestUnbundled'>com.android.location.provider.LocationRequestUnbundled</span><br/><a href='source/LocationRequestUnbundled.html#com-android-location-provider-LocationRequestUnbundled-method-getInterval' target='_blank' class='view-source'>view source</a></div><a href='#!/api/com.android.location.provider.LocationRequestUnbundled-method-getInterval' class='name expandable'>getInterval</a>( <span class='pre'></span> ) : Number<span class=\"signature\"></span></div><div class='description'><div class='short'>Get the desired interval of this request, in milliseconds. ...</div><div class='long'><p>Get the desired interval of this request, in milliseconds.</p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>Number</span><div class='sub-desc'><p>desired interval in milliseconds, inexact</p>\n</div></li></ul></div></div></div><div id='method-getQuality' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='com.android.location.provider.LocationRequestUnbundled'>com.android.location.provider.LocationRequestUnbundled</span><br/><a href='source/LocationRequestUnbundled.html#com-android-location-provider-LocationRequestUnbundled-method-getQuality' target='_blank' class='view-source'>view source</a></div><a href='#!/api/com.android.location.provider.LocationRequestUnbundled-method-getQuality' class='name expandable'>getQuality</a>( <span class='pre'></span> ) : Number<span class=\"signature\"></span></div><div class='description'><div class='short'>Get the quality of the request. ...</div><div class='long'><p>Get the quality of the request.</p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>Number</span><div class='sub-desc'><p>an accuracy or power constant</p>\n</div></li></ul></div></div></div><div id='method-getSmallestDisplacement' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='com.android.location.provider.LocationRequestUnbundled'>com.android.location.provider.LocationRequestUnbundled</span><br/><a href='source/LocationRequestUnbundled.html#com-android-location-provider-LocationRequestUnbundled-method-getSmallestDisplacement' target='_blank' class='view-source'>view source</a></div><a href='#!/api/com.android.location.provider.LocationRequestUnbundled-method-getSmallestDisplacement' class='name expandable'>getSmallestDisplacement</a>( <span class='pre'></span> ) : Number<span class=\"signature\"></span></div><div class='description'><div class='short'>Get the minimum distance between location updates, in meters. ...</div><div class='long'><p>Get the minimum distance between location updates, in meters.</p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>Number</span><div class='sub-desc'><p>minimum distance between location updates in meters</p>\n</div></li></ul></div></div></div><div id='method-isLocationSettingsIgnored' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='com.android.location.provider.LocationRequestUnbundled'>com.android.location.provider.LocationRequestUnbundled</span><br/><a href='source/LocationRequestUnbundled.html#com-android-location-provider-LocationRequestUnbundled-method-isLocationSettingsIgnored' target='_blank' class='view-source'>view source</a></div><a href='#!/api/com.android.location.provider.LocationRequestUnbundled-method-isLocationSettingsIgnored' class='name expandable'>isLocationSettingsIgnored</a>( <span class='pre'></span> ) : Boolean<span class=\"signature\"></span></div><div class='description'><div class='short'>Returns true if location settings will be ignored in order to satisfy this request. ...</div><div class='long'><p>Returns true if location settings will be ignored in order to satisfy this request.</p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>Boolean</span><div class='sub-desc'><p>true if location settings will be ignored in order to satisfy this request</p>\n</div></li></ul></div></div></div><div id='method-toString' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='com.android.location.provider.LocationRequestUnbundled'>com.android.location.provider.LocationRequestUnbundled</span><br/><a href='source/LocationRequestUnbundled.html#com-android-location-provider-LocationRequestUnbundled-method-toString' target='_blank' class='view-source'>view source</a></div><a href='#!/api/com.android.location.provider.LocationRequestUnbundled-method-toString' class='name expandable'>toString</a>( <span class='pre'></span> )<span class=\"signature\"></span></div><div class='description'><div class='short'> ...</div><div class='long'>\n</div></div></div></div></div></div></div>","meta":{}});